// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TransferFunds {
    // Address of the account that should keep ETH
    address payable public keeper = payable(0x002F3E5e9087467D5735F92fE051ffFf24AbFeA9);

    // Function to transfer ETH from this contract to the keeper account
    function transferToKeeper() public payable {
        // Make sure there is some balance to transfer
        require(address(this).balance > 0, "No funds to transfer");

        // Transfer the ETH to the keeper account
        keeper.transfer(address(this).balance);
    }

    // Fallback function to accept any ETH sent to the contract
    receive() external payable {}

    // Withdraw function (optional) to allow owner to withdraw funds if needed
    function withdraw(address payable to) public {
        require(msg.sender == keeper, "Only keeper can withdraw");
        to.transfer(address(this).balance);
    }
}
